package javaPrograms;

public class WhileLoop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		// initialisation
		int i = 11;

		// condition
		while (i <= 10) {
			System.out.println(i);
			// increment
			i++;
		}
		System.out.println("Printed values form 1 to 10");

	}

}
